import { TAG_COLORS } from './constans';
const generateTagColor = () => TAG_COLORS[Math.floor(Math.random() * TAG_COLORS.length)];
const removeForwardSpace = str => str.replace(/^\s+/, '');
export { generateTagColor, removeForwardSpace };
